import React, { Component } from "react";
import { getNasaPics } from "./services";

class Apiinfo extends Component {
  state = {
    dailyPics: [],
    randomPic: [],
    date: "DD-MM-YYYY",
    today: new Date().toISOString().slice(0, 10),
    datePic: {},
  };
  async componentDidMount() {
    const dailyPics = await getNasaPics();
    this.setState({ dailyPics });
  }
  render() {
    return (
      <div>
        <h1>NASA's Astronomy Picture of the Day</h1>

        <div>
          <img src={this.state.dailyPics} alt={""} />
        </div>
      </div>
    );
  }
}
